import React from "react";
// import Table from "../Table";

import "./products.css";

const Products = () => {
  return (
    <div className="products">
      <h1 className="title-dashboard">المنتجـات</h1>
      <p>عدد المنتجات 37 منتج</p>
      <div className="search-add-product flex-between">
        <div className="search">
          <input type="text" placeholder="البحث" />
          <button>بحث</button>
        </div>
        <button>اضافة منتج</button>
      </div>
      <div className="display-table flex">
        <span>شكل العرض</span>
        <i className="fa-solid fa-bars bar"></i>
        <i className="fa-solid fa-border-all"></i>
      </div>
    </div>
  );
};

export default Products;
